Rocco is being shown to his new corporate housing by Miss Cox as he works on his latest movie. He is a big director and the bubbly Miss Cox is making him tired after his long flight. Just as she is finishing her tour, he gets a call that his actress for tomorrow is out sick. He makes a joke about getting her to do the part, but Kandi says the movies she has made was in the bedroom with her ex-husband. That gets her fire started and next thing you know, Rocco is on his back getting serviced by the lovely housing manager.
